// ===== LOGOS PARA PDFs =====
// Convierte tus logos a Base64 en: https://base64.guru/converter/encode/image


const logosEscuela = {
  logoIzquierdo: "data:image/png;base64,",
  logoDerecho: "data:image/png;base64,",
  



  
  // Configuracin de logos
  config: {
    // Logo izquierdo
    izq: {
      x: 15,      // Posicin X (mm desde la izquierda)
      y: 10,      // Posicin Y (mm desde arriba)
      ancho: 25,  // Ancho en mm
      alto: 25    // Alto en mm
    },
    // Logo derecho
    der: {
      x: 170,     // Posicin X
      y: 10,      // Posicin Y
      ancho: 25,  // Ancho en mm
      alto: 25    // Alto en mm
    }
  },
  
  // Color institucional para PDFs (RGB)
  colorInstitucional: {
    hex: '#6C1D45',
    rgb: [108, 29, 69]  // Conversin de #6C1D45 a RGB
  }
};

// Funcin para agregar logos al PDF
function agregarLogosAlPDF(doc) {
  // Logo izquierdo
  if (logosEscuela.logoIzquierdo && 
      !logosEscuela.logoIzquierdo.includes('iVBORw0KGgoAAAANSUhEUgAAAAUA')) {
    try {
      const cfg = logosEscuela.config.izq;
      doc.addImage(logosEscuela.logoIzquierdo, 'PNG', cfg.x, cfg.y, cfg.ancho, cfg.alto);
    } catch (e) {
      console.log('Error al cargar logo izquierdo:', e);
    }
  }
  
  // Logo derecho
  if (logosEscuela.logoDerecho && 
      !logosEscuela.logoDerecho.includes('iVBORw0KGgoAAAANSUhEUgAAAAUA')) {
    try {
      const cfg = logosEscuela.config.der;
      doc.addImage(logosEscuela.logoDerecho, 'PNG', cfg.x, cfg.y, cfg.ancho, cfg.alto);
    } catch (e) {
      console.log('Error al cargar logo derecho:', e);
    }
  }
}